        (393, 'Пропавшие вещи из старой столицы', 'Убежище', 'green.png', 'Робкий научный исследователь был вынужден участвовать в миссии по строительству нового наблюдательного пункта в Нулевой каверне. Что ждёт его? Никто не даст гарантий.', 'Не получено'),
