        (397, 'Пропавшие вещи из старой столицы', 'Когда-то это было здесь', 'green.png', 'Предположим следующее: девушка в дорогом платье во время бедствия сбежала из дома, который ненавидела, и угодила в каверну. Из вещей она взяла лишь цветок в горшке, который затем пересадила куда-то ещё, а от горшка взяла с собой лишь осколок. По непонятной причине цветок рос слишком быстро, и у девушки осталось только совсем немноо семян. На этом история и завершается. По словам самой девушки, она была счастлива, но так ли это или нет - неизвестно.', 'Не получено'),
